  <meta name='viewport' content='width=device-width,initial-scale=1,maximum-scale=1,user-scalable=no'>
  <script>
  var CTA = { onClick: function(){ FbPlayableAd.onCTAClick(); } };

  <style>
    html,body{margin:0;padding:0;width:100%;height:100%;background:#000;overflow:hidden;}
    :root{--btn-w:36vw;--btn-max-w:360px;--btn-min-w:180px;}
    #container{position:relative;width:100%;height:100%;overflow:hidden;background:#000;touch-action:manipulation;}
#video-a, #video-b {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  object-fit: cover;
  opacity: 0;
  transition: opacity 0.3s ease;
  transform: translateZ(0);
  -webkit-transform: translateZ(0);
}

#video-a.active, #video-b.active {
  opacity: 1;
}

#video-a.top, #video-b.top {
  z-index: 2;
}

#video-a.fading, #video-b.fading {
  opacity: 0;
}
#freeze{position:absolute;inset:0;width:100%;height:100%;object-fit:cover;background:#000;opacity:0;z-index:6;pointer-events:none;transition: opacity 0.05s}
    #freeze.visible{opacity:1;}
    .btn{position:absolute;left:50%;bottom:7%;transform:translateX(-50%) scale(1);width:clamp(var(--btn-min-w),var(--btn-w),var(--btn-max-w));height:auto;animation:pulse 1.1s ease-in-out infinite;pointer-events:none;opacity:0;transition:opacity 300ms ease;z-index:25;}
    .btn.visible{opacity:1;}
    @keyframes pulse{0%{transform:translateX(-50%) scale(1);}50%{transform:translateX(-50%) scale(1.06);}100%{transform:translateX(-50%) scale(1);}}
    #logo{position:absolute;left:12px;top:0;width:10vh;height:auto;object-fit:contain;z-index:30;cursor:pointer;}
    #packshot{position:absolute;inset:0;display:flex;align-items:center;justify-content:center;background:rgba(0,0,0,0.5);opacity:0;transition:opacity 350ms ease;z-index:15;pointer-events:none;}
    #packshot.visible{opacity:1;pointer-events:auto;}
    #packshot-logo{width:30vh;height:auto;object-fit:contain;}
    #tap-layer{position:absolute;inset:0;z-index:20;background:transparent;}
  </style>
</head>

  var videoA = document.getElementById('video-a');
var videoB = document.getElementById('video-b');
var current = videoA;
var next = videoB;
var btn = document.getElementById('packshot-button');
var logo = document.getElementById('logo');
var tap = document.getElementById('tap-layer');
var packshot = document.getElementById('packshot');

var stage = 0;
var started = false;
var soundUnlocked = false;
var currentClipKey = null;
var transitioning = false;

function log(msg){
  console.log('[Video] ' + msg + ' | stage=' + stage);
}

function preloadAll() {
  try {
    ['p1', 'p2', 'p3', 'p4', 'p5'].forEach(function(k) {
      var v = document.createElement('video');
      v.muted = true;
      v.setAttribute('playsinline', '');
      v.setAttribute('webkit-playsinline', '');
      v.preload = 'auto';
      v.src = clips[k];
      v.style.display = 'none';
      document.body.appendChild(v);
      v.load();
    });
    log('Preloaded all clips');
  } catch(e) {
    console.error('Preload error:', e);
  }
}

function unlockSound() {
  if (soundUnlocked) return;
  soundUnlocked = true;
  if (current && !current.muted) return;
  
  if (current) {
    current.muted = false;
    current.removeAttribute('muted');
    current.volume = 1.0;
    safePlay(current);
  }
  if (next) {
    next.muted = false;
    next.removeAttribute('muted');
    next.volume = 1.0;
    safePlay(next);
  }
  log('Sound unlocked');
}

function safePlay(v) {
  if (!v) return;
  try {
    v.setAttribute('playsinline', '');
    v.setAttribute('webkit-playsinline', '');
    var p = v.play();
    if (p && p.catch) {
      p.catch(function(err) {
        console.warn('Play error:', err);
      });
    }
  } catch(e) {
    console.error('Play error:', e);
  }
}

function showBtn(show) {
  if (show) btn.classList.add('visible'); else btn.classList.remove('visible');
}

function transitionTo(clipKey, loop, onComplete) {
  if (transitioning) {
    log('Already transitioning, ignoring');
    return;
  }
  
  transitioning = true;
  log('Transitioning to: ' + clipKey + ' loop=' + loop);
  
  currentClipKey = clipKey;
  
  // Настраиваем next видео
  next.src = clips[clipKey];
  next.currentTime = 0;
  next.loop = loop;
  next.preload = 'auto';
  
  if (!soundUnlocked) {
    next.muted = true;
  } else {
    next.muted = false;
    next.volume = 1.0;
  }
  
  next.load();
  
  var startTransition = function() {
    log('Starting visual transition');
    
    // Показываем next
    next.classList.add('active');
    setTimeout(function() {
      next.classList.add('top');
    }, 10);
    
    // Запускаем next
    safePlay(next);
    
    // Скрываем current через 400мс
    setTimeout(function() {
      current.classList.remove('top');
      current.classList.add('fading');
      
      setTimeout(function() {
        current.classList.remove('active', 'fading');
        
        try {
          current.pause();
          current.currentTime = 0;
        } catch(e) {}
        
        // Swap указателей
        var tmp = current;
        current = next;
        next = tmp;
        
        transitioning = false;
        log('Transition complete');
        
        if (onComplete) onComplete();
      }, 300);
    }, 100);
  };
  
  // Ждем готовности next
  if (next.readyState >= 3) {
    startTransition();
  } else {
    var onReady = function() {
      startTransition();
    };
    next.addEventListener('canplay', onReady, {once: true});
    
    // Таймаут на случай если canplay не сработает
    setTimeout(function() {
      if (transitioning && next.readyState >= 2) {
        log('Timeout fallback, forcing transition');
        startTransition();
      }
    }, 1000);
  }
}

function start() {
  if (started) return;
  started = true;
  log('Starting');
  
  preloadAll();
  
  stage = 1;
  currentClipKey = 'p1';
  showBtn(true);
  
  // Настраиваем первое видео
  current.src = clips.p1;
  current.currentTime = 0;
  current.loop = true;
  current.preload = 'auto';
  current.muted = true;
  
  current.classList.add('active', 'top');
  
  current.load();
  
  var startPlay = function() {
    safePlay(current);
    log('First video playing');
  };
  
  if (current.readyState >= 3) {
    startPlay();
  } else {
    current.addEventListener('canplay', startPlay, {once: true});
  }
}

window.activatePart = function() { start(); };

function handleTap() {
  unlockSound();
  safePlay(current);
  
  if (stage === 1) {
    log('User tap: p1 -> p2');
    stage = 1.5;
    showBtn(false);
    
    // Отключаем loop и ждем окончания
    current.loop = false;
    
    var onP1End = function() {
      transitionTo('p2', false, function() {
        stage = 2;
        log('Now playing p2');
        
        // Ждем окончания p2
        var onP2End = function() {
          transitionTo('p3', true, function() {
            stage = 3;
            showBtn(true);
            log('Now playing p3 (loop)');
          });
        };
        current.addEventListener('ended', onP2End, {once: true});
      });
    };
    current.addEventListener('ended', onP1End, {once: true});
    return;
  }
  
  if (stage === 3) {
    log('User tap: p3 -> p4');
    stage = 3.5;
    showBtn(false);
    
    current.loop = false;
    
    var onP3End = function() {
      transitionTo('p4', false, function() {
        stage = 4;
        log('Now playing p4');
        
        // Ждем окончания p4
        var onP4End = function() {
          transitionTo('p5', true, function() {
            stage = 5;
            showBtn(true);
            log('Now playing p5 (loop)');
          });
        };
        current.addEventListener('ended', onP4End, {once: true});
      });
    };
    current.addEventListener('ended', onP3End, {once: true});
    return;
  }
  
  if (stage === 5) {
    log('User tap: show packshot');
    packshot.classList.add('visible');
    CTA.onClick();
  }
}

// Защита от паузы для looping видео
function onPause(v) {
  if (v === current && v.loop && !transitioning) {
    setTimeout(function() {
      if (v === current && v.paused && v.loop) {
        log('Resuming paused loop video');
        safePlay(v);
      }
    }, 100);
  }
}

videoA.addEventListener('pause', onPause);
videoB.addEventListener('pause', onPause);

tap.addEventListener('click', handleTap);
logo.addEventListener('click', function() { CTA.onClick(); });

if (document.readyState === 'loading') {
  document.addEventListener('DOMContentLoaded', start);
} else {
  start();
}
    })();
  </script>
